import '../styles/globals.css'
import { motion, AnimatePresence } from "framer-motion"

export default function ({ Component, pageProps }) {
  return (
  	<AnimatePresence>
  		<motion.div initial='initial' animate='animate' exit={{ opacity: 0 }}>
  			<Component {...pageProps} />
  		</motion.div>
  	</AnimatePresence>
  )
}
